import LogIn from './components/LogIn';
import {Link} from 'react-router-dom';

function App(){

  const navBar = () => {
    return (<div>
      <li>
        <Link to="/register">register</Link>
      </li>
      <li>
        <Link to="/login">login</Link>
      </li>
    </div>);
  };

  return (
  <Fragment>
    <LogIn  />
    </Fragment>);
}

export default App;
